import React from 'react';

const Hero = ({ data }) => {
  return (
    <section className="hero">
      <div className="hero-content">
        <h1>{data.headline}</h1>
        <p>{data.subheadline}</p>
      </div>
      <div className="cta-buttons">
        {data.ctaButtons.map((button, index) => (
          <a key={index} href={button.link} className="cta-button">
            {button.text}
          </a>
        ))}
      </div>
    </section>
  );
};

export default Hero;
